        if (mode==="dark") {
            setMode('light')
            document.body.style.backgroundColor = "white"
        }else {
            setMode('dark')
            document.body.style.backgroundColor = "black"
        }
    }
  return (
    <div>Navtoggle</div>
  )
}

export default Navtoggle
